import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTwitterSquare, faGithubSquare } from '@fortawesome/free-brands-svg-icons';

export default function Social() {
    return (
        <div className="social__container">
            <a href="#" target='_blank' className="social__link twitter">
                <FontAwesomeIcon icon={faTwitterSquare} size='xl'/>
            </a>

            <a href="#" target='_blank' className="social__link github">
                <FontAwesomeIcon icon={faGithubSquare} />
            </a>
        </div>
    )
}
